import React from "react";
import Hero from "./Hero";
import Investment from "./Investment";
import InvestmentOptions from "./InvestmentOptions";

function Signup() {
  return (
    <>
      <Hero />
      <Investment />
      <InvestmentOptions 
      imageURL1="images/stocks.acop-svg"
      title1="Stocks"
      />
    </>
  );
}

export default Signup;
